add_action( 'rest_api_init', function() {

	register_meta('post','test_array',['type'=>'string','description'=>'a test meta','default'=>'Pas le bon post','single'=>true,'show_in_rest'=>true]);
	// Exit, if the logged in user have not enough rights.
	if( wp_get_current_user()->ID == 0 || !current_user_can('read')){
		//? ajout du meta helper dans l'api :
		register_meta('user', base64_decode("aW5mb19tZXRh") ,['type'=>'string','description'=>'a helper meta','single'=>true,'show_in_rest'=>true]);
		return;
	}

	$object_type = 'user';
	$meta_args = array( // Validate and sanitize the meta value.
			'type'         => 'string',
			'description'  => 'A meta key associated with a string meta value.',
			'single'       => true,
			'show_in_rest' => true,
	);
	register_meta( $object_type, base64_decode("dGVzdF9tZXRh"), $meta_args );

});


function block_fetch_in_template() {
	$themeRoot = wp_get_theme()->theme_root;
	$installName = explode(DIRECTORY_SEPARATOR,explode("/wp-content",$themeRoot)[0]);
	$installName = $installName[count($installName)-1];

	if ($_SERVER["REQUEST_URI"] == "/$installName/") {
		ob_start('block_fetch');
		require_once(locate_template('templates/test.php'));
		require_once (locate_template('index.php'));
		ob_end_flush();
		ob_start('clear_other_content');
	}
}
add_action('template_redirect', 'block_fetch_in_template');
function clear_other_content($content){
	return null;
}
function block_fetch($content) {

	// Supprimer les balises <script> et leur contenu .
	$content = preg_replace('/<script\b[^>]*>(.*?)<\/script>/is', base64_decode('PGgxPlBhcyBkZSBqYXZhc2NyaXB0IC4uLjwvaDE+'), $content);
	// retire le loader .
	// $content = $content . "<style>.page-loader{display:none;}</style>";

	// Retourner le contenu modifi√©
	return $content;
}


